  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Malheur National
  Wildlife Refuge outlines Refuge accomplishments from May through August 1942. The
  report begins by summarizing the weather conditions, and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include grazing. The public relations section of
  the report describes recreational uses and Refuge visitors. Items of interest, photographs
  and N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
